/*
  Welcome.js

  This component handles the GUI for the welcome screen, which is the first screen the user will see after they
  successfully log in. There are multiple ways the user can interact with this screen, which will offer different
  features that Chariot offers.

*/

import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';

import './Welcome.css';

class Welcome extends Component {

  render() {
    return (
      <div className="container" id="welcomeContent">

        {/* Top divs of this screen. Contains user's public account information and links to stored configuration files. Also contains a logout button */}
        {/* Update account img source to be an import */}
        <div>
          <img alt="Account Avatar" className="accountAvi" src="data:image/png;base64,"></img>
        </div>
        <div className="accountInfo">
          <b>Name: </b> __________ <br></br>
          <div>
            <Link className="link" to="/networkConfigsMain" id="networkConfigsMainLink">View Network Configurations</Link>
            <br></br>
            <Link className="link" to="/deviceConfigsMain" id="deviceConfigsMainLink">View IoT Device Configurations</Link>
            <br></br>
            <Link className="link" to="/dataOutputConfigsMain" id="dataOutputConfigsMainLink">View Data Output Configurations</Link>
          </div>

          <div>
            <Link to="/">
              <Button className="logout-button" variant="primary">Log Out</Button>
            </Link>
          </div>
        </div>

        {/* Network manager portion of welcome page. Contains the link to go to 'Network Manager' screen and description of what that entails */}
        <div>
          <Link className="link" to="/networkManager">Network Manager</Link>
          <br></br>
          View, create, delete, modify, or manage your existing networks.
        </div>

        <br></br>

        {/* Data analysis portion of welcome page. Contains the link to go to 'Data Analysis' screen and description of what that entails */}
        <div>
          <Link to="/dataAnalysisMain">Perform Data Analysis</Link>
          <br></br>
          Select a storage unit and perform data analysis.
        </div>

        {/* Button to go to screen that will allow user to configure settings to begin a data collection episode */}
        <Link to="/chooseNetwork">
          <Button className="footer-button" variant="primary">Configure Data Collection</Button>
        </Link>
      </div>
    );
  }

}

export default Welcome;
